import * as React from 'react';
import Paper from '@material-ui/core/Paper';
import {
  ArgumentAxis,
  ValueAxis,
  Chart,
  LineSeries,
} from '@devexpress/dx-react-chart-material-ui';


const data = [
  { argument: "08-2019", value: 8 },
  { argument: "09-2019", value: 8 },
  { argument: "10-2019", value: 8 },
  { argument: 4, value: 8 },
  { argument: 5, value: 10 },
  { argument: 6, value: 10 },
  { argument: 7, value: 10 },
  { argument: 8, value: 10 },
  { argument: 9, value: 10 },
  { argument: 10, value: 12 },
  { argument: 11, value: 12 },
  { argument: 12, value: 12 },
  { argument: 13, value: 12 },
  { argument: 14, value: 12 },
];

const NewList = () =>  (
  <Paper style={{boxShadow: 'none', width: '80%', marginLeft: '9%'}}>
    <Chart
      data={data}
      height={200}
    >
      <ArgumentAxis />
      <ValueAxis />

      <LineSeries valueField="value" argumentField="argument" />
    </Chart>
  </Paper>
);

export default NewList;
